from collections import Counter

ids = set()

for x in TWEETS:
    ids.add(int(x[0]))

text = []
for x in TWEETS:
    text.append(x[1])

Hashtags = []
Callouts = []
for x in text:
    b = x.split()
    for a in b:
        if '#' in a:
            Hashtags.append(a)
        elif '@' in a:
            Callouts.append(a)

Hashtag = Counter(Hashtags)
Callout = Counter(Callouts)

def find_top_keys(DICT, num_keys):
    vals = []

    for val in DICT.values():
        vals.append(val)
    vals = sorted(vals, reverse=True)
    top_vals = []
    index = 0

    while num_keys >0:
        val = vals[index]
        top_vals.append(val)
        index +=1
        num_keys -=1

    top_keys = []
    for x in top_vals:
        for k,v in DICT.items():
            if x == v:
                top_keys.append(k)

    top_dict = dict(zip(top_keys, top_vals))
    return top_dict

print(find_top_keys(Hashtag, 5))
print(find_top_keys(Callout, 5))







    
  

